import React from 'react'


class TEST extends React.Component {
      render() {
        return(
            <div className='booklist'>
                {this.props.bookData.map((data) => {
                    return (< View data={data} key={data.id} />)
                })}
                <span>{this.props.data.title}</span>
            </div>
        )
    }
}

export default TEST;
